import PropTypes from 'prop-types';

function Button({ children,
  primary,
  secondary,
  success,
  warning,
  danger,
  outline,
  rounded
}) {
  return <button>{children}</button>;
}

Button.propTypes = {
  checkVariationValue: (props) => {
    return new Error('Invalid props dsadsaasd')
  },
};

export default Button;
